【特長】<br>車体後方の下側に隠れている障害物や人を確認するための補助ミラーです。バックする時の安全確認に便利です。<br><br>視界の広い3D曲面のミラーなので、目視やサイドミラなので、目視やサイドミラー・ルームミラーでは見えない範囲を補えます。<br><br>ミラー部分の位置調節や角度調節が可能です。<br><br>【メーカー】<br>カーメイト<br><br>【製品サイズ】<br>H120×W140×D65(mm)<style type="text/css">
