本カーボン仕様でスポーティーに！！<br>
リムフランジをキズから守る！<br><br>

「リムガードII」は幅4mm仕様（従来品は10mm）により、純正ホイールにも対応可能になりました。<br>
マジカルカーボンを使用しており、ドレスアップだけではなく、縁石等への衝突などからリムを保護しキズを最小限に抑えます。<br>
※ホイールのリム部分が4mm未満の場合は、ご使用になれません。<br><br>

